                        "closed_at": null,
                        "body": "<p>Washington, PA (PRWEB) July 02, 2014</p>\n<p>Ten liberal arts colleges in Pennsylvania have received an $ 800,000 grant from The Andrew W. Mellon Foundation to create the Pennsylvania Consortium for the Liberal Arts (PCLA), an entity designed to help each institution create new cost efficiencies, improve the quality of academic and co-curricular programs, and enhance inter-institutional knowledge and collaboration.</p>\n<p></p>\n<p>The consortium also plans to contribute in important ways to national discussions about improving access to higher education and improving affordability for families.</p>\n<p></p>\n<p>The 10 Pennsylvania colleges are: Bryn Mawr College, in Bryn Mawr, Pa.; Dickinson College, in Carlisle, Pa.; Franklin &amp; Marshall College, in Lancaster, Pa.; Gettysburg College, in Gettysburg, Pa.; Haverford College, in Haverford, Pa.; Juniata College, in Huntingdon, Pa.; Muhlenberg College, in Allentown, Pa.; Swarthmore College, in Swarthmore, Pa.; Ursinus College, in Collegeville, Pa.; and Washington &amp; Jefferson College in Washington, Pa.</p>\n<p></p>\n<p>The grant, which will be expended over three years, will provide seed money for collaborative programs among the various participants. The member colleges, each with its individual assets, will contribute and benefit in ways distinct to their institutional strengths and needs. In pursuing the Mellon grant, the leaders of the institutions asserted that their first priority as a consortium &ldquo;is to enhance the strong liberal arts preparation we provide our students while controlling associated costs.&rdquo;</p>\n<p></p>\n<p>&ldquo;Liberal arts colleges across the country face serious challenges &mdash; shifting demographics, student access, affordability and the pressure to keep up with new technology,&rdquo; said Tori Haring-Smith, president of Washington &amp; Jefferson College. &ldquo;Bringing Pennsylvania liberal arts colleges into a consortium helps us leverage our collective strengths to better serve our students.&rdquo;</p>\n<p></p>\n<p>The 10 consortium members will explore and develop collaborative programs in seven core areas: academic program improvement; faculty development; study abroad; library resources; administrative services; compliance and risk management; and enhancing the institutional climate for diversity.<br><br>\nCollaborative initiatives may include:</p>\n<p></p>\n<p>&ndash;Using teleconferencing and online technology to combine under-enrolled courses at member institutions. For example, in the coming academic year Juniata, Gettysburg and Washington &amp; Jefferson will each do the planning to allow them to offer a language course that will be shared across their campuses.<br><br>\n&ndash;Training for faculty chairs of academic departments; for example, bringing faculty together with college leaders to better understand and examine financial models, workshops on teaching in a diverse classroom, using technology to enhance learning, and the evolving role of the humanities.<br><br>\n&ndash;Shared study abroad sites and programs to reduce costs and expand opportunities for students.<br><br>\n&ndash;Shared library resources, including the expertise of subject specialists and consulting services for such issues as disaster planning and digitization.<br><br>\n&mdash; Cooperatives in areas such as health plans, branding and licensing, sustainability management, security in information technology, and purchasing.<br><br>\n&ndash;Shared expertise and staffing for compliance and risk management.<br><br>\n&ndash;Shared training for faculty and administrators on issues of race, gender, class and sexual orientation, as well as joint efforts to build pipelines for diverse faculty recruiting.</p>\n<p></p>\n<p>&ldquo;Pennsylvania enjoys an extraordinary concentration of the nation&rsquo;s finest private liberal arts colleges, and working together we can all be stronger and more effective and efficient in our missions,&rdquo; Muhlenberg President Randy Helm said. &ldquo;This consortium will serve as the foundation for new, collective institutional efforts to tackle some of the pressing issues facing higher education.&rdquo;</p>\n<p><br><br><br><br><br><br clear=\"all\"></p>\n<p>More <a target=\"_blank\" href=\"http://ift.tt/1Mp7rXX\">Ursinus College Press Releases</a></p>\n<br><br>\nvia WordPress http://ift.tt/1Ku740A"
