                        "body": "In any operating system you need to install libraries for your developments (and your users also need to have installed these libraries) such as Java or C++\r\n\r\nIn OSjs libraries needed are javascript, css and php as jQuery, Bootstrap or TCPDF, respectively\r\n\r\nIt would be very nice to install these libraries from the store (or by command line), and when someone downloads and app, the system detects what libraries needs and download all of them\r\n\r\nThis aspect will be atractive for all developers that want to develop under OSjs"
