                        "closed_at": null,
                        "body": "<p><img style=\"float: left; margin: 0 20px 10px 0;\" src=\"http://ift.tt/1BZsaBH\"><br><br><br><br></p>\n<p style=\"\">St Paul Plumbers at MCQ Plumbing Heating AC</p>\n<p><br></p>\n<p class=\"article-date\"><br>\nSt Paul, MN (PRWEB)<br>\nJune 28, 2015</p>\n<p class=\"responsiveNews\"><a target=\"_blank\" href=\"http://ift.tt/1BZscJH\" rel=\"nofollow\">St Paul plumbers</a> at MCQ Plumbing Heating AC have been helping people with all types of plumbing repairs for over 130 years. Their newest discount coupon is for $ 75 off the purchase and installation of a new water heater. The coupon can be used for hot water heater replacement or the installation of new water heater in a new location. The offer ends on 12/31/2015 and must be mentioned when scheduling the initial service call. There are a wide range of options to choose from including tankless or on demand units.</p>\n<p></p>\n<p class=\"responsiveNews\">&ldquo;We are offering a brand new coupon for a water heater because we get a lot of calls from people who are asking for water heater repair. Unfortunately when our <a target=\"_blank\" href=\"http://ift.tt/1dqXL3h\" rel=\"nofollow\">St Paul plumbers</a> get on site they have to inform the homeowner that the unit needs to be replaced because it&rsquo;s beyond repair,&rdquo; says John of MCQ Plumbing Heating AC. With this new coupon they are hoping to ease the burden homeowners are experiencing with the unexpected cost of a new water heater. &ldquo;We want to put a smile on people&rsquo;s face by helping them save a little money.&rdquo;</p>\n<p></p>\n<p class=\"responsiveNews\">In addition to being service plumbers MCQ Plumbing Heating AC is also an experienced <a target=\"_blank\" href=\"http://ift.tt/1BZscJJ\" rel=\"nofollow\">St Paul sewer repair contractor</a>. They provide basic sewer services like main line cleaning and cleanout installation as well as more complicated services like complete sewer line replacement. &ldquo;We are proponents of doing a full inspection on the sewer main line to best determine the condition of the pipe. After the inspection our highly trained technicians can recommend some repair options and the homeowner can choose the one that fits best,&rdquo; says John. Another service they offer is hydro jetting otherwise known as water jetting.</p>\n<p></p>\n<p class=\"responsiveNews\">Hydro-Jetting is the process of clearing the sewer line without using a traditional rotary rooter machine. According to the <a target=\"_blank\" href=\"http://ift.tt/1dqXIUZ\" rel=\"nofollow\">Minneapolis plumbers</a> at MCQ Plumbing Heating AC the best way to really clean a sewer line properly is with hydro-jetting equipment. &ldquo;If there are tree roots or grease balls blocking the pipe a normal rotary rooter machine will only clear the blockage temporarily because the tip of the rooter can&rsquo;t clear the whole line. Hydro-jetting uses a high pressure water stream to cut through all of the debris in the pipe,&rdquo; says John. Water jetting can cut right through tree roots, grease balls, household items and other blockage in the pipe. The only drawback is that the sewer pipe must be in good enough condition to withstand the water pressure.</p>\n<p></p>\n<p class=\"responsiveNews\">In situations where a thorough inspection of the main line reveals that it can&rsquo;t withstand water jetting other repairs may be needed. The <a target=\"_blank\" href=\"http://ift.tt/1Fem6Gp\" rel=\"nofollow\">Minneapolis sewer repair pros</a> at MCQ Plumbing Heating AC can fix just the parts of the pipe that are severely damaged or broken as opposed to a complete pipe replacement in some cases. John says, &ldquo;If a spot repair is possible our plumbers will educate the homeowner about location of problems within the pipe and explain repair options for doing a spot repair or replacement. Of course if part of the pipe is broken it may be an indication that the rest of the pipe will weaken over time.&rdquo;</p>\n<p></p>\n<p class=\"responsiveNews\">In addition to being experts plumbers the experts at MCQ Plumbing Heating AC are also experienced <a target=\"_blank\" href=\"http://ift.tt/1dqXIV1\" rel=\"nofollow\">St Paul air conditioning repair</a> and replacement contractors. They are currently offering A/C repair specials and they can get to most customers the same day. &ldquo;When it comes to being comfortable, people want fast service and we understand that. So we do everything we can to dispatch one of our friendly HVAC technicians as soon as possible. We can troubleshoot common problems and make repairs but we also provide homeowners with high efficiency heating and air conditioning systems if their current system is substandard,&rdquo; says John. All of the plumbers and HVAC technicians from MCQ are highly trained, drug screened and background checked for the safety of their customers.</p>\n<p></p>\n<p class=\"responsiveNews\">To learn more about the Minneapolis and <a target=\"_blank\" href=\"http://ift.tt/1BZscJN\" rel=\"nofollow\">St Paul AC repair</a> and air conditioning contractors and plumbers at MCQ Plumbing Heating AC please visit their website. To schedule service now please call (651) 222-9590 to have an HVAC service technician or experienced plumber dispatched immediately. People should also call (651) 222-9590 to take advantage of the new plumbing discount for a new water heater.</p>\n<p></p>\n<p class=\"responsiveNews\"><a target=\"_blank\" href=\"http://ift.tt/1cuG6an\" rel=\"nofollow\">MCQ Plumbing Heating AC</a><br><br>\n1324 Grand Ave<br><br>\nSaint Paul, MN 55105<br><br>\n(651) 222-9590</p>\n<p><br><br><br><br><br><br clear=\"all\"></p>\n<br><br>\nvia WordPress http://ift.tt/1BZscJT"
