                        "body": "<p><strong>'Who do you talk to?' Families often struggle over mental illness</strong><br>\nThat's what Jim and Jeannie Rippl learned about loving someone with a mental illness in the National Alliance for the Mentally Ill (NAMI) Wisconsin Family to Family Education Program (F2F). Their daughter, Heather Rippl, suffered from borderline &hellip;<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1dyaz8Y\">Beloit Daily News</a><br><br></i></p>\n<p><strong>American loses to Army in muddled Patriot League play</strong><br>\nAmerican head coach Mike Brennan directs his team during the first half of a second-round game against the Wisconsin in the NCAA college basketball tournament Thursday, March 20, 2014, in Milwaukee. (AP Photo/Morry Gash) more &gt;. By Tom Schad &ndash; The&nbsp;&hellip;<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1dqXL39\">Washington Times</a><br><br></i></p>\n<p><strong>6 dynamics that could make or break the next Congress</strong><br>\n\"He would like to end with some initiatives that would solidify his reputation beyond health care,\" Gillon said. \"Something in the last couple of years that would be a bookend on his presidency and that shows that he didn't peak in the first year or &hellip;<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1BZsctg\">USA TODAY</a><br><br></i></p>\n<p><strong>Harvick: Tracks must be proactive</strong><br>\nBoth Harvick and JGR owner Joe Gibbs praised NASCAR's safety initiatives in the past 14 years. After the death of Earnhardt, NASCAR began requiring head-and-neck restraints and began taking a more thorough look at seats and restraining devices.<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1Jz9bkb\">ESPN</a><br><br></i></p>\n<p><strong>Super Bowl 2015: Patriots vs. Seahawks TV Schedule, Start Time and <b>&hellip;</b></strong><br>\nProtecting quarterback Tom Brady has to be chief among the Patriots' initiatives on Sunday. If he's under duress, it opens the door for mishaps. If Seattle is able to get that pressure without blitzing, it will then make it difficult to establish the &hellip;<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/15LjvDw\">Bleacher Report</a><br><br></i></p>\n<p><strong>Wisconsin board recommends campaign finance overhaul</strong><br>\nFederal judges in Milwaukee have struck down contribution limits for individual donors and political committees. A federal appeals court found that the GAB can't force non-candidate groups to report spending on anything that doesn't expressly call for &hellip;<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1dqXIUU\">Washington Times</a><br><br></i></p>\n<p><strong><b>Milwaukee</b> Public Schools signs onto Obama's 'My Brother's Keeper' <b>initiative</b></strong><br>\nEfforts like these aren't new to Milwaukee. Obama's initiative follows up on campaigns to reduce disparities from a list of local groups, such as the Saving our Sons program, the Milwaukee Boys to Men Coalition and the Milwaukee Fatherhood Initiative.<br><i>Read more on <a target=\"_blank\" rel=\"nofollow\" href=\"http://ift.tt/1G2v1GP\">Milwaukee Journal Sentinel</a><br><br></i></p>\n<br><br>\nvia WordPress http://ift.tt/1BZsaBx"
